import React from "react";
import "./Button.css"
import PianoIcon from "./piano.png";


const Button = () => {
    const Http = new XMLHttpRequest();
    Http.open("POST",'localhost:6969' );
    
    return ( <div class="container">
        <div class="upCenter">
        <img src={PianoIcon} /> 
        </div>
    
    <       div class="center">
    
      <button onClick={Http.send()} >Click here to create a music </button>
    </div>
  </div>);
};

export default Button;
